import React, { Component } from 'react'


class BlogList extends Component {
    constructor(props){
        super(props);
        this.state = {date: new Date()};
    }
    render(){
        return (
            <div>
                <h1>Blog List {this.state.date.toLocaleTimeString()}</h1>
            </div>
        );
    }
}

export default BlogList
